  `format` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `genre` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `system` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
