  `sound` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `control` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `players` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `languages` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
